function sendMail(myData) {
  pdf_$.ajax({
    url: baseUrl + "/sendPDF",
    type: "POST",
    contentType: "application/json",
    data: JSON.stringify(myData)
  }).done(function () {
    showMessage(t("gestion", "Email sent"));
  }).fail(function () {
    showMessage(t("gestion", "Is your global mail server configured in Nextcloud?"));
  });
}

function capture(afterCapturefunction) {
  showMessage(t("gestion", "Creation in progress …"));

  pdf_$(".bootstrap-iso").css("width", "1200px");
  pdf_$(".bootstrap-iso").css("padding-right", "20px");
  pdf_$(".bootstrap-iso").css("padding-left", "20px");
  
  html2canvas(pdf_$(".bootstrap-iso")[0], {
    scrollY: -window.scrollY,
    dpi: 600,
  }).then((canvas) => {
    var data = genPDF(canvas.toDataURL("image/jpg"), canvas);
    afterCapturefunction(data);
  });

  pdf_$(".bootstrap-iso").css("width", "");
  pdf_$(".bootstrap-iso").css("padding-right", "");
  pdf_$(".bootstrap-iso").css("padding-left", "");
}

function genPDF(imgData, canvas) {

  var doc = new jsPDF("p", "mm");
  var imgWidth = 210;
  var pageHeight = 295;
  var imgHeight = canvas.height * imgWidth / canvas.width;
  var heightLeft = imgHeight;
  var position = 0;

  doc.addImage(imgData, "JPG", 0, position, imgWidth, imgHeight);
  heightLeft -= pageHeight;

  while (heightLeft >= 0) {
    position += heightLeft - imgHeight;
    doc.addPage();
    doc.addImage(imgData, "JPG", 0, position, imgWidth, imgHeight);
    heightLeft -= pageHeight;
  }

  var pdf = btoa(doc.output());
  var n = "";
  var to = pdf_$("#to").val().split(";");
  var Cc = pdf_$("#Cc").val().split(";");
  var subject = pdf_$("#subject").val();
  var body = pdf_$("#body").val();

  if (pdf_$("#factureid").length) {
    n = t("gestion", "INVOICE") + "_" + pdf_$("#pdf").data("name");
  } else {
    n = t("gestion", "QUOTE") + "_" + pdf_$("#pdf").data("name");
  }

  var myData = { name: n, subject: subject, body: body, to: JSON.stringify(to), Cc : JSON.stringify(Cc), content: pdf, folder: pdf_$("#theFolder").val() + "/" + pdf_$("#pdf").data("folder") + "/" };

  return myData;
  //doc.save('devis.pdf');
}


